import Link from "next/link"
import {Get_db} from "../data/post"
var data=({postData})=>(
    <body>
        <div> Date bese</div>
        <Link href="/">Home page </Link>
        <h1>{postData.id}</h1>
    </body>
)

export async function getStaticProps({params}){
    const postData=Get_db(params.id)
    return{
        props:{
            postData
        }
    }
}
export default data
